import React, { useState, useEffect } from "react";
import './Styles.css';
import { MainButton } from "./MainButton";
import { TopActiveButton } from "./TopActiveButton";
import { TopPassButton } from "./TopPassButton";
import { SignInForm } from "./SignInForm";
import wit_img from './img/wit-Photoroom.png';
import Modal from "./Modal";

export const Header = (props) => {
    const [modal, setModal] = useState(false);
    const [isScrolled, setIsScrolled] = useState(false);

    const toggleModal = () => {
        setModal(!modal)
    }

    // –≠—Ñ—Ñ–µ–∫—Ç –¥–ª—è –∏–∑–º–µ–Ω–µ–Ω–∏—è —Ö–µ–¥–µ—Ä–∞ –ø—Ä–∏ —Å–∫—Ä–æ–ª–ª–µ
    useEffect(() => {
        const handleScroll = () => {
            setIsScrolled(window.scrollY > 50);
        };

        window.addEventListener('scroll', handleScroll);
        return () => window.removeEventListener('scroll', handleScroll);
    }, []);

    useEffect(() => {
        const handleEscape = (event) => {
            if (event.key === 'Escape') {
                setModal(false);
            }
        };

        if (modal) {
            document.addEventListener('keydown', handleEscape);
        }

        return () => {
            document.removeEventListener('keydown', handleEscape);
        };
    }, [modal]);

    if(modal) {
        document.body.classList.add('active-modal')
    }
    else {
        document.body.classList.remove('active-modal')
    }

    return (
        <header className={`header ${isScrolled ? 'scrolled' : ''}`}>
            <div className="header-container">
                {/* –õ–æ–≥–æ—Ç–∏–ø –∏ –Ω–∞–≤–∏–≥–∞—Ü–∏—è */}
                <div className="header-left">
                    <img src={wit_img} alt="wit" className="header-logo"/>
                    <nav className="header-nav">
                        <TopActiveButton text='Lessons'/>
                        <TopPassButton text='Vocabulary'/>
                        <TopPassButton text='Practice'/>
                        <TopPassButton text='Progress'/>
                    </nav>
                </div>

                {/* –ü—Ä–∞–≤–∞—è —á–∞—Å—Ç—å - –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å –∏ –∫–Ω–æ–ø–∫–∞ */}
                <div className="header-right">
                    <div className="user-info">
                        <div className="user-avatar">üë§</div>
                        <span className="user-name">User Name</span>
                    </div>

                    <div className="header-actions">
                        <div className='sign-in-button' onClick={toggleModal}>
                            <div className="main-button-container">
                                <button className="main-button-background">Sign in</button>
                                <div className="main-button-foreground"></div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>

            {/* –ú–æ–¥–∞–ª—å–Ω–æ–µ –æ–∫–Ω–æ */}
            {modal && (
                <div className="modal">
                    <div onClick={toggleModal} className="overlay"></div>
                    <div className="modal-content">
                        <SignInForm/>
                    </div>
                </div>
            )}
        </header>
    )
}

